static TfLiteStatus AllocatePersistentBuffer(struct TfLiteContext* /*unused*/,
                                                 const size_t bytes, void**const ptr) {
  static uint8_t *AllocPtr = tensor_arena + sizeof(tensor_arena);

  AllocPtr -= bytes;
  *ptr = reinterpret_cast<void*>(AllocPtr);
  return kTfLiteOk;
}
